import { Button, Table } from "reactstrap";


const CastingTable = ({ data, setEdit, showModal, setShowModal }) => {

    const sendData = (casting) => {
        setEdit(casting)
        setShowModal(!showModal)
    }

    return (
        <Table striped responsive>
            <thead>
                <tr>
                    <th>First Name</th>
                    <th>Last Name</th>                   
                    <th></th>
                </tr>
            </thead>
            <tbody>
                {

                    (data.length < 1) ? (
                        <tr>
                            <td colSpan="4">No records</td>
                        </tr>
                    ) : (
                            data.map((item) => (

                                <tr key={item.castByMovie.CastId}>
                                    <td>{item.castByMovie.FirstName}</td>
                                    <td>{item.castByMovie.LastName}</td>
                                </tr>
                        ))
                    )
                }
            </tbody>
        </Table>
    )
}

export default CastingTable;
